import './App.css';
import React, { useEffect, useState } from "react";

const App = () => {
  const [email, setEmail] = useState('')
  const [password, setPassword] = useState('')
  const [emailDirty, setEmailDirty] = useState(false)
  const [passwordDirty, setPasswordDirty] = useState(false)
  const [emailError, setEmailError] = useState('Email не пожет быть пустым')
  const [passwordError, setPasswordError] = useState('Пароль не может быть пустым')
  const [formValid, setFormValid] = useState(false)

  useEffect(() => {
    if (emailError || passwordError) { 
      setFormValid(false)
      }else{
        setFormValid(true)
      }
    }, [emailError, passwordError])

  const emailHandler = (e) => {
    setEmail(e.target.value)
    const regex = /^((?!\.)[\w\-_.]*[^.])(@\w+)(\.\w+(\.\w+)?[^.\W])$/;
    if(!regex.test(e.target.value)){
      setEmailError('Некорректный email')
    } else{
      setEmailError('')
    }
  }

  const passwordHandler = (e) => {
    setPassword(e.target.value)
    if (e.target.value.length < 4){
      setPasswordError('Пароль должен быть длиннее')
      if(!e.target.value){
        setPasswordError('Пароль не может быть пустым')
      }
    } else{
      setPasswordError('')
    }
  }


  const blurHandler = (e) => {
      switch (e.target.name){
          case 'email':
              setEmailDirty(true)
              break
          case 'password':
              setPasswordDirty(true)
              break
      }
  }

  return (
  <div className='app'>

        <div class='e3_7011'>
          <h1  class="e3_6976">Log In Daily Shelf</h1>
        </div>
       <form id="singin">
              <div class='e2_6795'>
              <div class='e3_6883'>
                <span  class="e3_6897">Username or email address</span>
                    <div class='ei3_6899_1_1035'>
                      {(emailDirty && passwordDirty) && <div classname="error" style={{color:"#FF0000", left:-30, position:"absolute", fontFamily: "Nunito Sans"}}>{emailError}</div>}
                      <input onChange={(e)=>emailHandler(e)} value={email} onBlur={(e)=>blurHandler(e)} name='email' type="text"/>
                      <span  class="e3_6898">Password</span>
                      <div className='password'>
                        <div>{(emailDirty && passwordDirty) && <div classname="error" style={{color:"#FF0000", left:-30, position:"absolute", fontFamily: "Nunito Sans"}}>{passwordError}</div>}
                        <input onChange={(e)=>passwordHandler(e)} value={password} onBlur={(e)=>blurHandler(e)} name='password' type="password"/> 
                      </div>

                    </div>     
                  </div>
                    <button disabled={!formValid} type='submit' class="ei6_1793_3_6922_1_3106">Log In</button>
                </div>               
                      <div class='ei3_6903_1_1143'>
                        <div class='ei3_6903_1_1143_272_2346'>
                          <div class='ei3_6903_1_1143_272_2346_387_46965'>
                            <div  class="ei3_6903_1_1143_272_2346_387_46966">
                          </div>
                        </div>
                      </div>
                    </div>
                    <div class='ei3_6903_1_1144'>
                      <span  class="ei3_6903_1_1144_1_1023">Forgot password</span>
                    </div>
              <div  class="e3_7006">
                </div>
                <div class='e3_7010'>
                  <span  class="e3_7009"> Create an account</span>
                  <span  class="e3_7008">New to Daily Shell?  </span>
                </div>
              </div>
              </form>
  </div>
  );
}

export default App;
